type":"Quad"},{"attributes":{},"id":"5884","type":"AllLabels"},{"attributes":{"source":{"id":"5641"}},"id":"5826","type":"CDSView"},{"attributes":{"dimensions":"width"},"id":"5696","type":"PanTool"},{"attributes":{"child":{"id":"5539"},"title":"Task Stream"},"id":"5834","type":"Panel"},{"attributes":{"overlay":{"id":"5486"}},"id":"5483","type":"BoxZoomTool"},{"attributes":{},"id":"5869","type":"BasicTickFormatter"},{"attributes":{"child":{"id":"5429"},"title":"Worker Profile (compute)"},"id":"5831","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"5857"},"group":null,"major_label_policy":{"id":"5858"},"ticker":{"id":"5443"},"visible":false},"id":"5442","type":"LinearAxis"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"5493","type":"Quad"},{"attributes":{},"id":"5521","type":"ResetTool"},{"attributes":{},"id":"5592","type":"CategoricalTicker"},{"attributes":{},"id":"5863","type":"BasicTickFormatter"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 267.37 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 47 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 226.62 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 17.33 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://153.5.72.120:34839 &lt;/li&gt;\n          &lt;li&gt; Workers: 11 &lt;/li&gt;\n          &lt;li&gt; Threads: 33 &lt;/li&gt;\n          &lt;li&gt; Memory: 327.80 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2023.3.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2023.3.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport argparse\nimport inspect\nimport os\nimport sys\n\nfrom box import Box\nfrom dask.distributed import Client\nfrom distributed import performance_report\n\ncurrent_dir = os.path.dirname(os.path.abspath(inspect.getfile(inspect.currentframe())))\nparent_dir = os.path.dirname(current_dir)\nparent_parent_dir = os.path.dirname(parent_dir)\nsys.path.insert(0, parent_dir)\nsys.path.insert(0, parent_parent_dir)\n\nfrom util.custom.common import get_dask_cluster\nfrom util.etl.jobs import etl_single_table_transformations, etl_augmentation\n\nLIST_TABLE_NAME = [\n    'LEGALLY_OPERATING_BUSINESS',\n    'PARKING_VIOLATION_ISSUED',\n    'VIOLATION_COUNTY',\n    'PERMITTED_EVENTS',\n    'SCHOOLS',\n    'TRAFFIC',\n    'REGISTERED_VEHICLES',\n    'WEATHER'\n]\n\nif __name__ == '__main__':\n    parser = argparse.ArgumentParser(\n        prog='ETL Master Job',\n        description='This script processes and augments the New York parking violation tickets.')\n\n    arg_data = parser.add_argument(\"-d\", \"--data\",\n                                   type=str,\n                                   help=f\"Specify dataset to process. If parameter is set to 'All' or not specified, all the possible datasets are processed. Possible values: {', '.join(LIST_TABLE_NAME)}.\",\n                                   default='None')\n    arg_augmentation = parser.add_argument(\"-a\",\n                                           \"--augmentation\",\n                                           help=\"Run data augmentation.\",\n                                           action='store_true',\n                                           default=False)\n    arg_env = parser.add_argument(\"-e\",\n                                  \"--env\",\n                                  help=\"Specify environment: 'local'/'hpc'.\",\n                                  type=str,\n                                  default='local')\n    args = parser.parse_args()\n\n    if args.env in ('local', 'hpc'):\n        environment_name = args.env\n    else:\n        raise argparse.ArgumentError(argument=arg_env,\n                                     message='Invalid argument value for environment. Add the \"-h\" option to see argument specifications.')\n\n    # Read configuration file\n    config = Box.from_yaml(filename='config/config.yaml')\n\n    # Initialize Dask cluster client:\n    #   - connects to SLURM if configuration is set to 'hpc'\n\n    print('Initializing Dask client...')\n    cluster = get_dask_cluster(config=config,\n                               environment_name=environment_name)\n\n    with Client(cluster,\n                timeout='120s') as client:\n\n        print(f'Dask client successfully initialized')\n        print(f'Scheduler: {cluster.scheduler.address}')\n        print(f'Cluster: {cluster.dashboard_link}')\n        with performance_report(filename=f\"assets/Performance Reports/Total-Performance-Report.html\"):\n\n            # Perform the initial data transformations\n            if args.data == 'All':\n                etl_single_table_transformations(\n                    list_table_name=LIST_TABLE_NAME,\n                    config=config,\n                    environment_name=environment_name\n                )\n            elif args.data in LIST_TABLE_NAME:\n                list_table_name = [args.data]\n                etl_single_table_transformations(\n                    list_table_name=list_table_name,\n                    config=config,\n                    environment_name=environment_name\n                )\n            elif arg_data != 'None':\n                raise argparse.ArgumentError(argument=arg_data,\n                                             message='Invalid argument value
